"Witaj na serwerze, {username}!", WELCOME_MESSAGE_INSTANT_INVITE : "**Zaproś swoich przyjaciół** do tego serwera klikając [Udostępnij](onShareClick) gdy jesteś gotowy.", WELCOME_MESSAGE_DESKTOP_APPS : "**Pobierz** [aplikację na pulpit](onDownloadClick) dla ogólnosystemowego Naciśnij I Mów, mniejszego zużycia CPU i łącza internetowego oraz innych funkcji.", WELCOME_MESSAGE_TUTORIAL : "**Dowiedz się więcej o Discordzie** w swoim tempie zapoznając się z wyskakującymi podpowiedziami.", WELCOME_MESSAGE_MOBILE_APPS : "**Pozostań w kontakcie** ze swoim serwerem ze [swojego telefonu](onDownloadClick), a nawet używaj Discorda grając na konsoli.", WELCOME_MESSAGE_SUPPORT : "**Skontaktuj się** z nami poprzez [nasze wsparcie techniczne]({supportURL}) lub na Twitterze [@discordapp]({twitterURL}) jeśli masz jakieś pytania lub potrzebujesz pomocy.", TIP_VOICE_CONVERSATIONS_TITLE : "Mów głośniej", TIP_VOICE_CONVERSATIONS_BODY : "To jest Twój **panel sterowania głosem**.\n\nUżyj tych przycisków aby włączyć mikrofon, wyłączyć dźwięk lub zmodyfikować ustawienia.\nMożesz zmienić swój tryb przechwytywania z **Aktywacji Głosowej na Naciśnij I Mów** klikając na zębatkę.", TIP_WRITING_MESSAGES_TITLE : "Porozmawiaj z innymi", TIP_WRITING_MESSAGES_BODY : "To jest miejsce gdzie będzisz wpisywał wszystkie swoje opcje i pomysły.\n\nAby było wszystko tip-top, dołączyliśmy składnę dla zaznaczeń, żeby wskazać **coś ważnego** lub\n__tupnąć w podłogę.__ Możesz także **przeciągać i upuszczać** obrazki oraz pliki w tym miejscu aby szybko\nsię podzielić tymi kocimi gifami. Tylko nie przesadzaj.", TIP_ORGANIZE_BY_TOPIC_TITLE : "Organizacja kanałów", TIP_ORGANIZE_BY_TOPIC_BODY : "", TIP_WHOS_ONLINE_TITLE : "W co grasz?", TIP_WHOS_ONLINE_BODY : "Ta lista pokazuje kto jest obecny na kanale.\n\nPrzy każdym kto używa pobranej aplikacji widoczny będzie również tytuł obecnie uruchomionej gry. Kliknięcie na nazwę użytkownika odkryje jego **ustawienia indywidualne**, jak kontrola głośności czy opcje administracyjne.", TIP_INSTANT_INVITE_TITLE : "Zaproś przyjaciół", TIP_INSTANT_INVITE_BODY : "Najedź myszką na jakikolwiek kanał tekstowy lub głosowy, by odkryć przycisk udostępniania. Użyj wygenerowanego linka, by zapraszać ludzi na wybrany kanał.\n\nZaawansowane ustawienia zaproszeń pozwalają na ograniczenie ilości zapraszanych ludzi lub dozwolonego czasu ważności zapraszania.", TIP_SERVER_SETTINGS_TITLE : "Kontroluj swój serwer", TIP_SERVER_SETTINGS_BODY : "Kliknij tutaj, aby uzyskać dostęp do ustawień Twojego serwera.\n\nMożesz modyfikować wiele różnych rzeczy, takich jak uprawnienia i role, wybór regionu swoich serwerów głosowych,\nustawienia kanału AFK, zarządzanie linkami z zaproszeniami, zbanowanymi użytkownikami lub nawet całkowite usunięcie twojego serweru.", TIP_DIRECT_MESSAGES_TITLE : "Rozpocznij prywatną konwersację", TIP_DIRECT_MESSAGES_BODY : "Możesz widzieć wszystkich znajomych ze wszystkich Twoich serwerów.\n\nZ każdym z nich możesz rozpocząć prywatną konwersacje poprzez wybranie znajomego z listy. Prywatne wiadomości są świetnym sposobem by skontaktować się z pojedynczą osobą, nawet jeśli są zajęci czymś innym. Jest to możliwe dzięki powiadomieniom na ich urządzeniu.", TIP_CREATE_MORE_SERVERS_TITLE : "Serwery wszędzie!", TIP_CREATE_MORE_SERVERS_BODY : "Kliknij przycisk plusa by utworzyć nowy serwer.\n\nPonieważ serwery są darmowe, możesz stworzyć ich dowolną liczbę. Każdy serwer pozwala Ci stworzyć unikatowe miejsce dla różnych grup ludzi. Możesz również usunąć serwery, gdy przestaną być potrzebne.", TIP_CREATE_FIRST_SERVER_TITLE : "Stwórz swój własny serwer", TIP_CREATE_FIRST_SERVER_BODY : "Kliknij na plus, aby stworzyć swój własny serwer.\n\nKażdy serwer pozwala Ci na posiadanie własnego miejsca dla różnych grup znajomych. Możesz zawsze usunąć serwer jeśli nie ma już na niego potrzeby. A co najlepsze, możesz tworzyć tyle serwerów ile Ci się podoba, ponieważ wszystkie są za darmo.", TIP_FRIENDS_LIST_TITLE : "Zobacz znajomych", TIP_FRIENDS_LIST_BODY : "Kliknij tutaj, aby wyświetlić prywatne wiadomości i status każdego użytkownika na wszystkich swoich serwerach.\n\nOtrzymane prywatne wiadomości ukażą się pod Twoim awatarem dla szybkiego i łatwego dostępu.", BAN_USER_TITLE : "", BAN_USER_CONFIRMED : "", BAN_CONFIRM_TITLE : "Grzmotnij Ban Hammerem w '!!{username}!!'", FORM_LABEL_DELETE_MESSAGE_HISTORY : "Usuń historię wiadomości", DELETE_MESSAGE_HISTORY_OPTION_NONE : "Nie usuwaj", DELETE_MESSAGE_HISTORY_OPTION_24HR : "Ostatnie 24 godziny", DELETE_MESSAGE_HISTORY_OPTION_7D : "Ostatnie 7 dni", NO : "Nie", YES : "Tak", CLOSE : "Zamknij", SEND : "Wyślij", CHOOSE : "Wybierz", SAVE : "Zapisz", SELECT : "Wybierz", START : "Rozpocznij", ADD : "Dodaj", SAVE_ASSET_SUCCESS_MOBILE : "", SAVE_ASSET_FAILURE_MOBILE : "", SAVE_ASSET_FAILURE_HELP_MOBILE : "", NO_CAMERA_ACCESS : "Discord nie ma dostępu do Twojej kamery", NO_PHOTOS_ACCESS : "Discord nie ma dostępu do Twoich zdjęć", ENABLE_PRIVACY_ACCESS : "Możesz włączyć dostęp w ustawieniach prywatności.", NO_PHOTO_IN_CAMERA_ROLL : "Brak zdjęć z aparatu", DELETE_MESSAGE_BODY_MOBILE : "Jesteś pewien, że chcesz usunąć tę wiadomość? Tego nie można cofnąć.", PIN_MESSAGE_BODY_MOBILE : "", JOIN_VOICE_CHANNEL : "Połączyć z tym kanałem głosowym?", LEAVE_SERVER_BODY_MOBILE : "Czy na pewno chcesz opuścić {name}?", KICK_USER_TITLE : "Wyrzuć '{user}'", KICK_USER_BODY : "Czy na pewno chcesz wyrzucić {user}? Będzie on mógł wrócić ponownie z nowym zaproszeniem.", KICK_USER_CONFIRMED : "", KICK_USER_ERROR_GENERIC : "", BAN_USER_BODY : "Czy na pewno chcesz zbanować {user}? Nie będzie on mógł wrócić dopóki go nie odbanujesz.", BAN_USER_ERROR_GENERIC : "", VOICE_DISCONNECT_TITLE : "Rozłącz czat głosowy", VOICE_DISCONNECT_BODY : "Rozłączyć z tym serwerem głosowym?", JOIN_AFK_CHANNEL_BODY : "Wygląda na to, że dołączyłeś do kanału AFK. Nie możesz mówić na tym kanale.", TAKE_PHOTO_OR_VIDEO : "", CAMERA_ROLL : "Album", IMAGE : "Obrazek", VIDEO : "", REPORT_TITLE : "", REPORT : "Zgłoś", REPORTED : "Zgłoszono", CLOSE